rA(){return A.a([new A.PM("A Pr\xe1tica da psicoterapia","Resolvi que colocaria no t\xedtulo desse texto, o mesmo nome do livro do Jung falando sobre essa pr\xe1tica t\xe3o transformadora, pois \xe9 nele que irei me basear para escrever esse texto, e, a inten\xe7\xe3o aqui n\xe3o \xe9 fazer conte\xfado para quem j\xe1 sabe, mas sim para quem quer conhecer um pouco mais sobre a pr\xe1tica. Vem comigo ent\xe3o!\nA psicoterapia pode ser aplicada de diversas formas, mas para a psicologia junguiana, ela usa o m\xe9todo dial\xe9tico. Este m\xe9todo \xe9 baseado numa pr\xe1tica dos fil\xf3sofos antigos, onde a intera\xe7\xe3o entre uma tese e uma ant\xedtese, gera uma s\xedntese, ou seja, uma afirma\xe7\xe3o ou pergunta direcionada a uma pessoa, recebe de volta outra (ou a mesma) afirma\xe7\xe3o ou pergunta, e isso \xe9 o suficiente para que um terceiro conte\xfado surja. Por isso, para Jung, a rea\xe7\xe3o espont\xe2nea do psicoterapeuta diante do conte\xfado trazido pelo paciente \xe9 muito importante. Na psicologia de Jung, essa dial\xe9tica acontece atrav\xe9s da intera\xe7\xe3o entre a psique do psicoterapeuta e paciente, do consciente e inconsciente de cada um, isso faz surgir novos conte\xfados que ser\xe3o capazes de causar a transforma\xe7\xe3o. Dentro do processo de psicoterapia, Jung traz como base 4 etapas: confiss\xe3o, esclarecimento, educa\xe7\xe3o e transforma\xe7\xe3o. Passarei por cada etapa de forma simplificada ao que Jung escreve em seu livro.\nA confiss\xe3o \xe9 a partilha do segredo, do que est\xe1 oculto e precisa ser colocado para fora, pois um segredo guardado apenas para si pode ser como um veneno ps\xedquico, gerando as mesmas consequ\xeancias de uma culpa. Manter um conte\xfado secreto pode levar a um segredo at\xe9 da pr\xf3pria consci\xeancia, e, isso formar um complexo, que \xe9 aut\xf4nomo num n\xedvel que se assemelha a uma \u201cmini\u201d psique fechada dentro da pr\xf3pria psique, carregado de emo\xe7\xf5es, que surge de forma muito espont\xe2nea e intensa quando voc\xea for tocado no \u201cponto certo\u201d. A etapa da confiss\xe3o pode ser inclusive a primeira e \xfaltima do processo, pois muitas pessoas podem se sentir curadas ap\xf3s conseguir botar pra fora o seu segredo.\nQuando o indiv\xedduo se conecta com o psicoterapeuta de forma significativa, ou seja, acontece a transfer\xeancia, entra a etapa do esclarecimento, onde o profissional n\xe3o pode simplesmente romper o v\xednculo, ainda que o seu paciente esteja \u201ccurado\u201d, pois isso pode trazer consequ\xeancias importantes \xe0 pessoa em tratamento. Como Jung diz no vol. 16/1 das suas obras completas, a confiss\xe3o devolve ao consciente conte\xfados que n\xe3o deveriam ter deixado a consci\xeancia, j\xe1 o esclarecimento traz \xe0 tona conte\xfado que jamais teriam condi\xe7\xf5es de se tornarem conscientes.\nNa etapa da educa\xe7\xe3o, o paciente ser\xe1 auxiliado sobre tudo o que ocorreu at\xe9 este momento da psicoterapia, pois houve j\xe1 uma transforma\xe7\xe3o, e, \xe9 necess\xe1rio que ele saiba o que fazer disso, reorganizar a sua vida diante dessa mudan\xe7a, dessa tomada de consci\xeancia de determinados conte\xfados. Nessa etapa, Jung diz que a depender do grau de sensibilidade moral do paciente, apenas um insight \xe9 suficiente.\nA quarta etapa \xe9 a da transforma\xe7\xe3o, que assim como todas as outras, n\xe3o tem a pretens\xe3o de ser a verdade absoluta alcan\xe7ada, o fim validado. Essa etapa vem para preencher uma lacuna deixada por todas as anteriores, vem para transcender tudo o que ocorreu at\xe9 esse momento, \xe9 a etapa onde acontece, mais ainda consolidada, a transforma\xe7\xe3o, e quem sabe, o momento que se entra em uma individua\xe7\xe3o consciente. \xc9 a etapa que vai elaborar melhor ainda todo o restante que aconteceu at\xe9 ent\xe3o.\nIsso \xe9 o que penso contemplar de maneira simplificada sobre a psicoterapia na psicologia do Jung. Se houver o interesse em iniciar esse processo, meu contato estar\xe1 dispon\xedvel aqui no site, podendo falar comigo diretamente pelo whatsapp. Por fim, gostaria de citar uma frase que tem no livro Mem\xf3rias, Sonhos, Reflex\xf5es, que apesar de todas as cr\xedticas (muito v\xe1lidas e corretas inclusive!), passa uma mensagem bonita e que acredito ser verdadeira. A frase diz o seguinte: \u201cOs di\xe1logos mais belos e cheios de consequ\xeancias que tive na vida foram an\xf4nimos\u201d.",A.a(["JUNG, C. G.. Princ\xedpios b\xe1sicos da pr\xe1tica da psicoterapia. In: JUNG, C. G..\xa0A pr\xe1tica da psicoterapia. Petr\xf3polis: Vozes, 2020. Cap. 1. p. 13-31","JUNG, C. G.. O que \xe9 a psicoterapia?. In: JUNG, C. G..\xa0A pr\xe1tica da psicoterapia. Petr\xf3polis: Vozes, 2020. Cap. 2. p. 32-39","JUNG, C. G.. Os problemas da psicoterapia moderna. In: JUNG, C. G..\xa0A pr\xe1tica da psicoterapia. Petr\xf3polis: Vozes, 2020. Cap. 5. p. 66-98"],t.s),"https://images.unsplash.com/photo-1551847677-dc82d764e1eb?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D")],t.kJ)},
